import react from "react";

const PrimaComponent = () => 
{
    return(
        <div>
            <h1>Foto</h1>
            <div className="row" style={{marginTop:"5%", padding:"5px"}}>
                <div className="row">
                    <div className="col">
                        <Ima numero="1" foto="https://storage.edidomus.it/ListinoAuto/FOTO_A_16_9_640/00052908.JPG"/>
                    </div>
                    <div className="col">
                        <Ima numero="2" foto="https://rentedrive.it/wp-content/uploads/2020/03/Toyota-Yaris-2020-Esterno-anteriore.jpg"/>
                    </div>
                    <div className="col">
                        <Ima numero="3" foto="https://rentedrive.it/wp-content/uploads/2020/03/Toyota-Yaris-2020-Esterno-posteriore.jpg"/>
                    </div>
                </div>
            </div>
        </div>
    );
}

const Ima = (props) =>
{
    let {numero,foto} = props;
    const titolo = 
    <>
        <h1>Foto numero: {numero}</h1>
    </>;
    return(
        <>
            {titolo}
            <div style={{padding:"20px",border:"1px solid black", display:"inline-block"}}>
                <img src={foto}></img>
            </div>
        </>
    );
}

export default PrimaComponent;
